CREATE VIEW public.calendar_plan AS
 SELECT ed.degree_name AS degree,
    (((st.code)::text || '_'::text) || (spec.number_in_speciality)::text) AS spec_code,
    ((fact.faculty_cipher)::text || (dept.department_number)::text) AS department,
    calendar.start_year,
    ((subjfact.faculty_cipher)::text || (subjdep.department_number)::text) AS department_of_subject,
    subj.subject_name,
    hpc.no_of_hours,
    ct.type_name,
    t.term_no
   FROM (((((((((((((((public.hours_per_class hpc
     LEFT JOIN public.calendar_item_cell cic ON ((hpc.calendar_cell_id = cic.cell_id)))
     LEFT JOIN public.calendar_item ci ON ((ci.calendar_item_id = cic.calendar_item_id)))
     LEFT JOIN public.class_type ct ON ((ct.type_id = hpc.class_type_id)))
     LEFT JOIN public.calendar calendar ON ((calendar.id = ci.calendar_id)))
     LEFT JOIN public.department_subject ds ON ((ci.department_subject_id = ds.id)))
     LEFT JOIN public.subject subj ON ((subj.subject_id = ds.subject_id)))
     LEFT JOIN public.term t ON ((t.term_id = cic.term_id)))
     LEFT JOIN public.department subjdep ON ((subjdep.department_id = ds.department_id)))
     LEFT JOIN public.faculty subjfact ON ((subjfact.faculty_id = subjdep.faculty_id)))
     LEFT JOIN public.department_to_specialization d2s ON ((calendar.dept_to_spec_id = d2s.id)))
     LEFT JOIN public.department dept ON ((dept.department_id = d2s.department_id)))
     LEFT JOIN public.faculty fact ON ((dept.faculty_id = fact.faculty_id)))
     LEFT JOIN public.specialization spec ON ((d2s.specialization_id = spec.id)))
     LEFT JOIN public.speciality st ON ((spec.speciality_id = st.id)))
     LEFT JOIN public.edu_degree ed ON ((st.degree_id = ed.degree_id)));


